import React, { Fragment,useContext } from "react";
import userContext from '../../context/user/userContext';


const FormEdit = () => {
    const userCont = useContext(userContext);
    const { userActually} = userCont;
  return (
    <Fragment>
      <form className="formulario-nuevo-proyecto">
        <img className="card-header" src={userActually.avatar} alt="" />
        <p>Name:</p>
        <input
          type="text"
          className="input-text wrapp"
          name="nombre"
          placeholder={userActually.first_name}
        />
        <p>LastName:</p>
        <input
          type="text"
          className="input-text wrapp"
          name="nombre"
          placeholder={userActually.last_name}
        />
        <p>Email:</p>
        <input
          type="text"
          className="input-text"
          name="nombre"
          placeholder={userActually.email}
        />
      </form>
      <button type="button" className="btn btn-block btn-primario">
        Edit user
      </button>
      <button type="button" className="btn btn-block btn-primario" onClick={()=>buttonGoAlbumFn()}>
        Show Albums
      </button>
    </Fragment>
  );
};

export default FormEdit;
